import React from "react";
import Mobile from "./Mobile";

const HomeBanner = () =>{
    return(
        <>
            <div className="home-banner-wrapper">
                <div className="left-side-container"></div>
                <Mobile />
            </div>
        </>
    );
}
export default HomeBanner;
